SELECT column_name, data_type, is_nullable
FROM information_schema.columns 
WHERE table_name = 'ch01_customers'
ORDER BY ordinal_position;

SELECT column_name, data_type, udt_name, numeric_precision, numeric_scale, character_maximum_length, datetime_precision, is_nullable
FROM information_schema.columns
WHERE table_name = 'ch01_customers'
ORDER BY ordinal_position;

DROP TABLE IF EXISTS ch01_customers;

CREATE TABLE ch01_customers (
    id INT PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    address VARCHAR(255) NOT NULL,
    city VARCHAR(100) NOT NULL,
    state VARCHAR(100) NOT NULL,
    country VARCHAR(100) NOT NULL,
    zipcode VARCHAR(20) NOT NULL,
    birthday DATE,
    age NUMERIC(5,2),
    gender VARCHAR(50),
    marital_status VARCHAR(50),
    dependents NUMERIC(5,2),
    phone_number BIGINT,
    email VARCHAR(255),
    preferences JSON,
    BirthCountry VARCHAR(100),
    AnnualIncome NUMERIC(12,2)
);

select * from ch01_customers limit 10;





